\section{Introduction}

Gamma-ray bursts (GRBs) are the most energetic explosions known to humankind. Although discovered in 1967 \citep{Klebesadel73a} by the \textit{Vela} Satellite Network, the physics of GRBs still remains unsolved. For example, the exact nature of the emission mechanism of the so-called prompt emission phase is still unclear. Today, we know that GRBs are gamma-ray emissions from cosmological sources \citep{Metzger97a} distributed isotropically across the sky \citep{Meegan92a,Pendleton94a,Briggs96a}. The two kinds of GRBs, long/soft and short/hard \citep{Kouveliotou93a}, are thought to have different origins. It is generally believed that long/soft (duration $T_{90} > 2$~s and low-energy photon rich) GRBs are the result of gravitational collapse events from massive progenitors, and short/hard ($T_{90} < 2$~s and high-energy photon rich) GRBs originate from compact merger events.

A powerful method to discern the physical properties and emission mechanisms of GRBs is through detailed spectral analysis. However, the spectral properties of individual GRB may be significantly different. Therefore, analysis of large samples of burst spectra is necessary to obtain a coherent physical picture. Such large spectral catalogs, some time-integrated and some time-resolved, have been published for many hard X-ray or gamma-ray observing instruments, e.g., the \textit{CGRO}/BATSE \citep[25~keV - 2~MeV,][]{Pendleton94a,Preece00a,Kaneko06a,Goldstein13a}, \textit{BeppoSAX}/GRBM \citep[40 - 700~keV,][]{Frontera09a}, \textit{Swift}/XRT \citep[0.2 - 10~keV,][]{Evans09a}, \textit{Swift}/BAT \citep[15 - 150~keV,][]{Sakamoto08a,Sakamoto11a}, \textit{Fermi}/LAT \citep[20~MeV - 300~GeV,][]{Ackermann13a}, and \textit{Fermi}/GBM \citep[time-integrated, 8~keV - 40~MeV,][]{Nava11a,Goldstein12a,Gruber14a,vonKienlin14a}.

This paper presents the first \textit{Fermi} Gamma-ray Burst Monitor (GBM) gamma-ray burst time-resolved spectral catalog. In contrast to previous time-resolved catalogs of other instruments, the broad energy range covered by the GBM allows a sensitive investigation at energies of a few hundred keV where the peaks or breaks of the prompt emission spectra are located. This catalog presents time-resolved fit parameters using standard fit functions, parameter-parameter and parameter-uncertainty correlations, spectral evolutionary trends over time (in particular the peak energy $E_\text{p}$ evolution), distributions of spectral slopes (given in photon indices $\alpha$ and $\beta$), and plausible blackbody components. A novel measure of the sharpness of the spectral peak has been reported separately for the same burst sample by \citet{Yu15b}. The measure places a strong constraint on the physics of prompt emission models, ruling out an optically thin synchrotron origin for the peak or break of the spectrum in a large majority of cases.

This paper is structured as follows. We describe the characteristics of GBM and the methods of data selection and reduction in Section~\ref{sect:method}. The fitting models used in this catalog are described in Section~\ref{sect:models}. The spectral analysis procedure is given in Section~\ref{sect:ana}, and the fitting results are presented in Section~\ref{sect:results}. We summarize our results and conclude in Section~\ref{sect:conc}. The spectral fitting results are tabulated in Appendix~\ref{app:bigtable}. Unless otherwise stated, all errors reported in this paper are given at the $1\sigma$ confidence level.

\section{The data}
\label{sect:method}

\subsection{Instrumentation}

The \textit{Fermi} Gamma-ray Space Telescope, launched in June 2008, harbors two scientific instruments, namely the Gamma-ray Burst Monitor \citep[GBM,][]{Meegan09a} and the Large Area Telescope \citep[LAT,][]{Atwood09a}. The GBM covers the energy range from  8~keV to 40~MeV, while the LAT is sensitive in the complementary energy range from 30~MeV to 300~GeV. The GBM observes the whole sky which is not occulted by the Earth ($>8$~sr) and provides real-time locations for GRB triggers. These real-time locations are circulated via the Gamma-ray Coordination Network\footnote{\url{http://gcn.gsfc.nasa.gov/gcn3_archive.html}} (GCN) which allows ground-based follow-up observations. Occasionally, an Autonomous Repoint Request (ARR) can be accepted by the Flight Software (FSW) which allows \textit{Fermi} to slew towards the direction of the source, so that it can be observed with the LAT.

There are twelve thallium activated sodium iodide detectors (NaI(Tl), hereafter NaI) and two bismuth germanate detectors (BGO) in the GBM instrument. These detectors serve as a sensitive scintillation array covering both the softer photons by the NaIs (8 - 900~keV) and the harder photons by the BGOs (250~keV - 40~MeV). The arrangement of the NaI detectors allows GBM to locate GRBs in a real-time manner; and the two BGO detectors are placed on opposite sides of the spacecraft in order to cover all bursts coming from any direction in the sky. The wide spectral coverage of over 3 orders of magnitude is the key to detailed spectral analysis for the GRB prompt emission phase.

\subsection{Detector selection}

We apply the same detector selection criteria used in all official GBM GRB time-integrated spectral catalogs \citep{Goldstein12a,Gruber14a,vonKienlin14a}. The detectors with viewing angle larger than 60\degr or blocked by the LAT or solar panels are removed \citep{Bissaldi09a,Goldstein12a,Gruber14a}. For every spectrum, a maximum of three NaIs with one BGO are used in the analysis. If more than three NaIs satisfied these criteria, the NaIs with the smallest viewing angles are used in order to avoid binning bias towards the lower energies \citep{Goldstein12a}.

\subsection{Data type selection}

There are three different types of data generated by GBM. The first type is CTIME which provides coarse spectral resolution of 8 energy channels and fine temporal resolution of 0.256~s during the nominal time period, i.e., before the trigger and 600~s after the trigger; during the trigger period, the resolution is increased to 64~ms. The second type is CSPEC which provides coarse temporal resolution at nominal (4.096~s) and trigger (1.024~s) period, and high spectral resolution of 128 pseudo-logarithmically scaled energy channels. The third type is time-tagged event (TTE) data which stores individual photon events tagged with arrival time (resolution of 2~$\mu s$), photon energy channel (128 pseudo-logarithmic energy channels), and detector number (NaI 0 - 11 and BGO 0 - 1). TTE data were stored on board GBM in a recycling buffer. After 26 November 2012\footnote{\url{http://fermi.gsfc.nasa.gov/ssc/data/access/gbm/}} this data type became continuous. When GBM is triggered, the spacecraft will transmit pre- and post-trigger TTE data (about 300~s in duration) to the ground as science data.

Since only TTE data from $\sim$30~s pre-trigger until $\sim$300~s post-trigger are available, for the bursts with evident precursor or emission longer than 300~s, CSPEC data (about 8,000~s in duration) are used. In this paper, CSPEC data are used for 15 GRBs, and for all other bursts TTE data are used.

\subsection{Energy channel selection and background fitting}

To account for the poor transparency for gamma rays of the silicone pad in front of the NaI crystal and of the Multi Layer Insulation (MLI) around the detectors \citep{Bissaldi09a}, the energy channels below 8~keV and the overflow channels above 900~keV are removed. A similar cutoff criterion is also used in the BGOs so that only energy channels between 250~keV and 40~MeV are used. An effective energy range from 8~keV to 40~MeV is used for the spectral analysis in this paper.

For each burst, a polynomial with order 2 - 4 is fit to every energy channel according to two user-defined background intervals, before and after the emission period. The background model is then interpolated across the emission period. This is done by varying the selected intervals and order of polynomial until the $\chi^2$ statistics is minimised over all energy channels. The resulting background intervals are then loaded to all detectors, generating the background model to be used in the spectral analysis. The background intervals used in this catalog are identical to those used in \citet{Gruber14a}.

\subsection{Burst and spectrum selection}

We first select all the bursts detected by GBM in the first 4 years (i.e., from 14 July 2008 to 13 July 2012), which is the same GRB subset as used in the 4-yr GBM GRB time-integrated spectral catalog \citep{Gruber14a,vonKienlin14a}. The GBM triggered on 954 GRBs in this period of time \citep[one of them triggered GBM twice, see][]{vonKienlin14a}. Time-resolved spectral analysis requires bright bursts with sufficiently high signal-to-noise spectra. This bright subsample is selected by applying the following criteria: 10~keV - 1~MeV energy fluence $f>4 \times 10^{-5}$~erg~cm$^{-2}$ and/or 10~keV - 1~MeV peak photon flux $F_\text{p}>20$~ph~s$^{-1}$~cm$^{-2}$ (in either 64, 256, or 1,024~ms binning timescales). These criteria are satisfied by 134 bursts out of the 954. Sixteen among them are of the short burst class.

In order to alleviate the problem that the spectra from the brightest bursts dominate the statistics, we further require each event to have at least 5 time bins in the light curves when binned with signal-to-noise ratio (S/N) $=30$. This optimal S/N is found by iterating the binning process on characteristic bursts drawn from various fluence and peak-flux level, which does not significantly merge peaks and valleys in the light curves while providing the highest number of time bins. As a result, 81 bursts satisfy these criteria; among them there is only one short burst (GRB 120323A; GBM trigger \#120323507). In total, 1,802 time-resolved time bins and spectra were obtained.

Four different empirical models are fit to each spectrum, resulting in a compilation of $1,802 \times 4 = 7,208$ spectral fits. Compared to the 4-yr GBM GRB time-integrated spectral catalog \citep{Gruber14a,vonKienlin14a}, the catalog presented here includes a lower number of GRBs (81 vs. 943), however, the number of high-resolution spectra is higher (1,491 BEST model fits, see Sect.~\ref{sect:results}, vs. 943).

\section{Fitting models}
\label{sect:models}

Four different empirical models are fit to the spectra in our sample, namely, the Band function, a smoothly broken power law, a cutoff power law (aka. the Comptonized model), and a simple power law.

\subsection{The Band function}

The Band function (BAND) is a model in which a power law with high-energy exponential cutoff and a high-energy power law are joined together by a smooth transition. It is an empirical function proposed by \citet{Band93a}, which fits most of the observed GRB spectra. Parametrized by the peak energy $E_\text{p}$ (despite the fact that there may not be a peak in the $\nu F_\nu$ space when the high-energy photon index $\beta \geq -2$) in the observed $\nu F_\nu$ spectrum, the photon model of BAND is defined as

text:
\begin{equation}
\label{eqn:band}
f_\text{BAND}(E) = A\left\{
\begin{array}{ll}
	\left(\frac{E}{100\text{ keV}}\right)^\alpha \exp\left[-\frac{(\alpha+2)E}{E_\text{p}}\right]: E<E_\text{c} \, , \\
	\left(\frac{E}{100\text{ keV}}\right)^\beta \exp\left(\beta-\alpha\right) \left(\frac{E_\text{c}}{100\text{ keV}}\right)^{\alpha-\beta}: E\geq E_\text{c} \, ,
\end{array}
\right.
\end{equation}

