\subsection{Conditions to have a peak in the $\nu F_\nu$ space}

For all the aforementioned mathematical functions, the resulting spectrum has a peak in $\nu F_\nu$ space if and only if $\alpha > -2$ and $\beta < -2$. Since the Band function presumes $\alpha > \beta$, for the BAND fits with $\alpha \le -2$, the spectrum decreases monotonically, and for those with $\beta \ge -2$, the spectrum increases monotonically. For the SBPL fits with $\alpha \le -2$ or $\beta \ge -2$, $E_\text{p}$ is not calculated because Eqn.~(\ref{eqn:sbplep}) is invalid. Similarly, for the COMP fits with $\alpha \le -2$, $E_\text{p}$ is just a break and the spectrum decreases monotonically, and obviously not there for the PL model.

\section{Spectral analysis method}
\label{sect:ana}

The light curves are binned according to the procedure described in Sect.~\ref{sect:method}, resulting in a total of 1,802 time bins and $1,802 \times 4 = 7,208$ spectra. Time-resolved spectral analysis is performed using the official GBM spectral analysis software RMFIT v4.3BA\footnote{The public version of the RMFIT software package is available at \url{http://fermi.gsfc.nasa.gov/ssc/data/analysis/rmfit/}}, with effective area corrections applied to each pairs of NaI and BGO detectors. RMFIT employs a modified forward-folding technique based on the Levenberg-Marquardt algorithm. During the fitting process, the fitting models discussed in Sect.~\ref{sect:models} are converted into counts. These counts are then compared to the observed counts and RMFIT iterates itself until a best fit is found according to the chosen statistics for minimization.

In order to fold the model spectra into count space in the forward-folding process, detector response matrices (DRMs) are generated using the GBM response matrices v2.0. These DRMs contain information about the angular dependence of the detector efficiency, effective area of the detectors, partial energy deposition, energy dispersion, nonlinearity in the detectors, and atmospheric and spacecraft scattering of photons into the detectors. Therefore, they are functions of photon energies, angular dependence between spacecraft and the source, and angle between spacecraft orientation relative to the Earth. In order to account for the orientation change of the detectors relative to the burst direction because of the slew of the spacecraft, DRMs are generated for every 2\degr on the sky and grouped into RSP2 files for each burst. This means each DRM is weighted by the counts in the detectors for every 2\degr of spacecraft slew.

The chosen statistics for minimization in the fitting process is the so-called Castor C-Statistics (CSTAT). This is a modified statistical function based on the original Cash statistics \citep{Cash79a}. Since the background is Poissonian, the net count statistics is non-Gaussian, CSTAT is preferable over the traditional $\chi^2$ statistics. However, CSTAT does not provide a goodness-of-fit measure as $\chi^2$, because there is no standard probability distribution for the likelihood of CSTAT. As a result, test statistics must be calculated and compared to the resulting CSTAT values by simulating the fitting model a large number of times, which allows us to reject a model up to a certain confidence level. Theoretically, this should be done for each burst separately, but due to the infeasibility of generating large number of simulated spectra for all bursts, we adopt the values given in \citet{Gruber14a} for models (8.58 for PL vs. COMP, and 11.83 for COMP vs. BAND or SBPL) with various numbers of free parameters. These values, what we call the critical $\Delta\text{CSTAT}$ or $\Delta\text{CSTAT}_\text{crit}$, are listed in Table~1 of \citet{Gruber14a}.

