We define the BEST model sample \citep[see][for example]{Goldstein12a,Gruber14a} by the following criteria: For each parameter $Q$ of a model, the relative error $\sigma_Q / Q \le 0.4$ except for all power-law indices; for models that have two power-law indices, the low-energy index error has to satisfy $\sigma_\alpha \le 0.4$, and the high-energy power-law index has to satisfy $\sigma_\beta \le 1.0$; for the single power law, the index error criterion is the same as $\alpha$'s; and the model has to have the lowest CSTAT after correcting the value by $\Delta\text{CSTAT}_\text{crit}$ (see Sect.~\ref{sect:ana}) comparing to other spectral model fits\footnote{In the first two GBM GRB time-integrated spectral catalogs, there was a definition of the GOOD sample. We do not include such a sample here in this catalog, since the GOOD criteria they used do not guarantee good fits. This is because the GOOD sample does not involve a goodness-of-fit criterion. We discuss this effect in Appendix~\ref{App:goodsample}.}. As a results, we are able to extract 1,491 BEST model fits out of the 1,802 spectra. The fit results of the BEST model of all spectra for all GRBs\footnote{In this paper, the names of the bursts are given according to the \textit{Fermi} GBM trigger designation that is assigned for each new trigger detected. The first 6 digits indicate the year, month, and day of the month, and the last 3 digits indicate the fraction of the day. For more details, please see the online \textit{Fermi} GBM burst catalog at \url{http://heasarc.gsfc.nasa.gov/W3Browse/fermi/fermigbrst.html}} are listed in Table~\ref{tab:bigtable}.

We note that BAND's $E_\text{b}$ and SBPL's $E_\text{p}$ are computed instead of fit parameters. Therefore, we compute $\sigma_{E_\text{b}}$ of BAND and $\sigma_{E_\text{p}}$ of SBPL by performing Monte-Carlo simulations using the errors of the best-fitting model parameters. We randomly draw new values of the model parameters from a uniform probability function sharing the same $1\sigma$ width. This process is repeated to generate 10,000 realizations, and a cumulative distribution function (CDF) is constructed. The errors are then obtained by taking the $1\sigma$ width of the resulting CDFs. This procedure generates the most conservative error values because the uniform probability function has the largest standard deviation.

The fit statistics for the BEST sample are listed in Table~\ref{tab:stat}. It can be seen that COMP has the largest fraction of BEST fits (69.1\%), SBPL and PL have 11.4\% and 10.2\% respectively, and BAND gives the lowest fraction, only 9.3\%. However, we note that these resulting statistics do not necessarily imply that the Comptonized model is generally favored over the Band function. \citet{Kaneko06a} and \citet{Goldstein12a} showed that there appeared to be a strong correlation between the S/N and the complexity of the BEST model. Therefore, we cannot rule out the possibility that this observed preference is due to poor count statistics at the high energies.

The mean and median values of the parameter distributions for the BEST sample are shown in Table~\ref{tab:para_stat}. The "Mean" columns show the average value of each parameter distribution and their errors are given by the standard deviations. The "Median" columns show the median and $1\sigma$ errors of each parameter by constructing the CDFs. For the approximately log-normally distributed $E_\text{p}$ and $E_\text{b}$ populations, log-normal distributions are fit to each population and the peak and 1$\sigma$ widths in base-10 logarithmic space are reported.

In Fig.~\ref{fig:BEST} we show the distributions of the BEST sample best-fit parameters. The top left panel shows the BEST distributions of the low-energy power-law index $\alpha$. It can be seen that there are two peaks in the ALL population. The peak at $\alpha \approx -0.7$, excluding those values from PL, is dominated by the COMP model. It can be seen that the population of SBPL's $\alpha$ is slightly softer than that of the BAND's and COMP's and also shows a larger spread. As discussed above, this effect is not due to the detector's lower limit because the histogram's bin width is wider than the deviation from the asymptotic limit. The $\alpha$ of PL fits are significantly softer than that of other models, with no $\alpha > -1.3$. The distinct behavior of PL to the other fit functions is evident.

The top right panel shows the BEST distributions of the high-energy power-law index $\beta$. It can be seen that the BAND's $\beta$ becomes more concentrated between $-3.1$ and $-1.6$, while the SBPL's $\beta$ extend to much steeper values of about $-4.4$.\footnote{BAND with $\beta = -4.4$ effectively mimics COMP, while SBPL with $\beta = -4.4$ does not. This is because the mathematical definitions of the curvatures of SBPL and BAND are different.} The peak of the populations is at $\beta \approx -2.1$. As a result, 21\% of the overall population of $\beta \ge -2$ (no peak in the $\nu F_\nu$ space).

The bottom left panel shows the BEST distributions for the $\nu F_\nu$ peak energy $E_\text{p}$. It can be seen that the $E_\text{p}$ population of COMP dominates the overall distribution, and that the COMP population extends to higher energies (up to about 5~MeV) than the BAND and SBPL populations, which instead extend to lower energies (down to about 20~keV). We do not find any spectrum with very large $E_\text{p}$, with only 4.8\% of the overall population of $E_\text{p} \ge 1$~MeV.

The bottom right panel shows the distributions for the break energy $E_\text{b}$. It can be seen that the $E_\text{b}$ population of BAND has a clear peak at $E_\text{b} \approx 130$~keV, while the $E_\text{b}$ population of SBPL has a broad distribution (from 40~keV to 300~keV).

These general statistics suggests that when performing spectral analysis of GRBs, one should not assume a Band spectrum \citep[e.g.,][]{Giblin99a,Gonzalez12a,Sacahui13a}. Instead, one should always try different fit functions and compare the fit statistics to find the best description to the data. Similar statistical behaviors are also observed in the time-integrated spectral catalogs \citep{Goldstein12a,Gruber14a}.

\subsection{The parameter-parameter scatter plots}
\label{para-para}

Figure~\ref{fig:para-para} shows the scatter plots between the best-fit parameters of the BEST sample. The top left panel shows the plot of $\beta$ against $\alpha$. Trends can neither be found between $\alpha$ and $\beta$ for individual models nor the overall population as a whole. It can be seen that SBPL's $\beta$ population extend to steeper values and have larger error bars in the same range of values of $\alpha$. The larger error for steeper $\beta$ shows that the SBPL tends to mimic a COMP spectrum, in which $\beta$ is poorly constrained due to less photon statistics at the higher energies.

The top middle panel shows the plot of $E_\text{p}$ against $\alpha$. Trends can neither be found between $\alpha$ and $E_\text{p}$ for individual models nor the overall population as a whole. It can be seen that while the data points seem to occupy the same region, SBPL's $E_\text{p}$ extends to lower energies and COMP's $E_\text{p}$ extends to higher energies, for similar range of values for $\alpha$.

The top right panel shows the plot of $E_\text{b}$ against $\alpha$. Similar to the plot of $E_\text{p}$, no trends can be found for $E_\text{b}$, and SBPL's $E_\text{b}$ extends to lower energies for similar range of values of $\alpha$. This is because, according to Eqns.~(\ref{eqn:bandeb}) and (\ref{eqn:sbplep}), $E_\text{p}$ is proportional to $E_\text{b}$.

The bottom left panel shows the plot of $E_\text{p}$ against $\beta$, and the bottom right panel shows the plot of $E_\text{b}$ against $\beta$. Since $E_\text{p}$ is proportional to $E_\text{b}$, the two plots show similar behaviors. A slight trend may exist between $E_\text{p}$ against $\beta$ in the population of BAND: steeper $\beta$ tends to have lower $E_\text{p}$. However, this trend is not seen in the population of SBPL.

These plots show that the SBPL produces larger uncertainties for steeper $\beta$, and has difficulties to constrain the high-energy power-law behavior in comparison to the Band function.

\subsection{The parameter-uncertainty scatter plots}
\label{para-uncer}

Figure~\ref{fig:para-uncer} shows the scatter plots between the best-fit parameters and uncertainties of the parameters of the BEST sample. The top left panel shows the plot of $\sigma_\alpha$ against $\alpha$. It is seen that the SBPL gives the most scatter and large errors (extend to almost $\sigma_\alpha = 0.4$), while other models give relatively small errors of $\sigma_\alpha < 0.2$. The PL gives the smallest $\sigma_\alpha \le 0.1$. A clear trend for $\sigma_\alpha$ can be seen: $\sigma_\alpha$ tends to be larger when $\alpha$ increases (i.e., becomes harder).

The top middle panel shows the plot of $\sigma_\beta$ against $\beta$. A clear trend is observed that $\sigma_\beta$ becomes larger when $\beta$ decreases (i.e., becomes softer/steeper). The trend is indeed expected because the high-energy power-law slope becomes less constrained when the BAND or SBPL mimics a COMP model, i.e., when there are less photon statistics at the high energies which leads to a cutoff behavior.

The top right panel shows the plot of $\sigma_{E_\text{p}}$ against $E_\text{p}$. It is observed that $\sigma_{E_\text{p}}$ of SBPL is systematically larger than that of BAND and COMP for the same value of $E_\text{p}$. The values of $\sigma_{E_\text{p}}$ for BAND and COMP also tend to lie above the dashed line, implying that $\sigma_{E_\text{p}}$ becomes larger when $E_\text{p}$ increases. We note that $E \approx 900$~keV is the upper energy boundary of the NaIs, so that there are only data contributed by the BGOs beyond this limit, providing less photon statistics and thus increases the uncertainty in determining the spectral peak position.

The bottom left panel shows the plot of $\sigma_{E_\text{b}}$ against $E_\text{b}$. Comparing to the peak energies, $\sigma_{E_\text{b}}$ of the break energies  $E_\text{b}$ have similar trends for both the BAND and SBPL fits. The errors lie systematically above the dashed line for both models.

It is also of interest to investigate how the position of the spectral peak affects the uncertainties in the spectral slopes. The bottom middle panel shows the plot of $\sigma_\alpha$ against $E_\text{p}$. A clear trend is observed that the low-energy power-law slope becomes more uncertain when the spectrum peaks at lower energies. This is because the low-energy spectral slope is determined by the photon statistics below the peak energy. When the peak energy is smaller, there are relatively fewer data points to constrain the value of the low-energy power-law slope. It is also observed that for the same value of $E_\text{p}$, $\sigma_\alpha$ tends to be larger for the SBPL fits than that for the BAND or COMP fits.

The bottom right panel shows the plot of $\sigma_\beta$ against $E_\text{p}$. A trend is observed that higher values of $E_\text{p}$ tend to produce smaller $\sigma_\beta$, which is weaker in comparison to the plot of $\sigma_\alpha$ against $E_\text{p}$. This shows that the high-energy power-law slope is not as strongly coupled to the peak position as the low-energy power-law slope.

These plots again show that the smoothly broken power-law model produces the highest degree of uncertainties in the best-fit parameters. This is not limited in the high-energy power-law index $\beta$, as shown in Fig.~\ref{fig:para-para}. Figure~\ref{fig:para-uncer} shows that SBPL's peak position significantly affects the uncertainties of both power-law indices, more so than the other models. The slight offsets of the best-fit parameters from different fit functions are expected because they have intrinsically different parametrical formulae. In general, we observe good consistency in the parameter space occupation, indicating that the minima in the parameter spaces are well defined and our results are statistically reliable.

\subsection{$E_\text{p}$ evolution}

Time-resolved spectral analysis of GRBs has shown that there are two different kinds of $E_\text{p}$ evolutionary trends \citep[e.g.,][]{Ford95a}, namely the intensity tracking and the hard-to-soft behavior. Intensity tracking bursts show evidence that the values of $E_\text{p}$ follow similar trends of the intensity (either photon flux or energy flux) in their light curves. Hard-to-soft bursts show evidence that $E_\text{p}$ decays (in general) monotonically with time.

We compute the Spearman's Rank Correlation Coefficient $\rho$ \citep{Spearman04a} between $E_\text{p}$ and (1) the 1~keV - 1~MeV photon flux,  $\rho_\text{ph}$, (2) the 1~keV - 1~MeV energy flux, $\rho_\text{en}$, and (3) the time, $\rho_\text{t}$. A positive value indicates a positive correlation, a negative value indicates a negative correlation, and a value of zero means no correlation. The process is repeated for different confidence levels of 90\%, 95\%, and 99\%. We note that the confidence levels are \textit{not} the probabilities to find $\rho$ within the confidence intervals. They are the \textit{ratios} of finding the real $\rho$ within the confidence intervals to the total number of repeated analysis. For example, the 99\% confidence interval of $\rho$ denotes that if the spectral analysis is repeated a large number of times, we will find on average, in 99 out of 100 times, that the real $\rho$ lies within the 99\% confidence interval. However, we will never know if we have picked the lucky ones, because we have no way to know the actual value of $\rho$. Therefore, the confidence level of a confidence interval provides a sense of how often a correlation is expected to be found.

First, we distinguish the $E_\text{p}$ evolutionary trends by machine. For each confidence level of the $\rho$'s, we check the following logical criteria:\footnote{We iterated the machine-based decision process for many different logical criteria, and found that the stated criteria provide a fairly robust determination of the trends comparing to human decisions. See main text and Table~\ref{tab:trends}.} (1) if $\rho_\text{ph}$ \textit{or} $\rho_\text{en} > 0.5$, \textit{and} it is not consistent with zero within the confidence interval; \textit{and} $\rho_\text{t} \ge -0.5$ \textit{or} it is consistent with zero within the confidence interval, then we define the trend as intensity tracking ("in.track."); (2) if $\rho_\text{ph} \le 0.5$ \textit{and} $\rho_\text{en} \le 0.5$, \textit{or} they are consistent with zero within their confidence intervals; \textit{and} $\rho_\text{t} < -0.5$ \text{and} it is not consistent with zero within the confidence interval, then we define the trend as hard-to-soft ("h.t.s."); (3) everything else are defined as undetermined ("undeter."). The values and confidence intervals of the $\rho$'s, and the machine-decided kinds of trends are listed in Cols.~(3) - (14) of Table~\ref{tab:trends}.

Then, we distinguish the $E_\text{p}$ evolutionary trends by human eyes (Col.~15 of Table~\ref{tab:trends}). We plot the $E_\text{p}$ evolutions (red data points, left axis) in Figs.~\ref{fig:Ep_evo1} - \ref{fig:Ep_evo4}, with the 10~keV - 1~ MeV energy flux (black histograms, right axis) and the 10~keV - 1~ MeV photon flux (grey histograms, arbitrary units) light curves overlaid. We note that we only plot and compare the 57 bursts with $E_\text{p}$ in at least 6 time bins or more. We find that the machine-based decision process is quite robust, in that only 2 bursts (3.5\%) are mis-attributed to the opposite kind ("h.t.s." vs. "in.track."), namely GRB 100719989 (Fig.~\ref{fig:Ep_evo2}) and GRB 111216389 (Fig.~\ref{fig:Ep_evo3}). The brightness of the first peak relative to the second peak of GRB 100719989 mimics a trend that $E_\text{p}$ is decaying with time. In contrast, a human would identify its intensity tracking nature by noticing the low $E_\text{p}$ in the first time bin and the small rise of $E_\text{p}$ values during the second peak. The case of GRB 111216389 is similar in that the relatively higher value but intensity tracking $E_\text{p}$ during the first peak to the second peak contributed to a small excess in $\rho_\text{t}$.

There are 12 GRBs (21\%) which show a mix of the two kinds of trends. Some of these bursts are identified by the computer as either one of the two kinds, or as undetermined. Two of them are especially worth mentioning: GRB 090618353 (Fig.~\ref{fig:Ep_evo1}) and GRB 091003191 (Fig.~\ref{fig:Ep_evo2}). They both show an initial hard-to-soft evolution followed by a later intensity tracking behavior, where the computer labeled them as undetermined. The other 10 bursts show a general hard-to-soft decay of $E_\text{p}$ where the values in between seem to follow the intensity profile. \citet{Lu12a} have shown that intrinsic hard-to-soft evolutions of distinct pulses can overlap and produce such a "h.t.s.+in.track." behavior. They claimed that both "h.t.s." and "in.track." behavior could be intrinsic to a burst or a pulse, which is consistent with our findings that many single pulsed bursts show pure intensity tracking behavior. We also find that the intensity tracking behavior of $E_\text{p}$ with the energy flux is more prominent than that with the photon flux in all of the intensity tracking bursts.

A few more bursts are worth of mentioning. GRB 100707032 (Fig.~\ref{fig:Ep_evo2}), GRB 110721200, and GRB 110920546 (both Fig.~\ref{fig:Ep_evo3}) are single pulsed, fast-rise-exponential-decay (FRED) bursts. All of them show pure hard-to-soft behavior. Since the $E_\text{p}$ evolutions and intensity profiles of these FRED bursts are very similar, $\rho_\text{en}$ and $\rho_\text{ph} \approx -\rho_\text{t} \gtrsim 0.5$, thus the computer cannot determine their evolutionary trends.

In short, we emphasize that even though the process of distinguishing "h.t.s." and "in.track." bursts can be done automatically, the existence of "h.t.s.+in.track." and FRED bursts can be ambiguous to computers. We strongly encourage checking by human eyes after any automated detection process of $E_\text{p}$ evolutionary trends.

\subsection{Search for blackbody emission}
\label{subsect:blackbody}

Many studies have reported evidence for thermal components with $kT \sim 10$~keV in various GRBs \citep[e.g.,][]{Meszaros02a,Ryde05a,Guiriec11a,Axelsson12a,Guiriec13a,Burgess14a,Burgess14b,Guiriec15a,Guiriec15b,Peer15b,Iyyani15a}. Therefore, adding a blackbody component (i.e., a Planck function) to the fit function is a natural way to explore the data in this time-resolved catalog. The blackbody model (BB) is defined as:
